      user_data.zp = gtmeecData.zp;
    }

    if (!user_data.ge && gtmeecData.ge) {
      user_data.ge = gtmeecData.ge;
    }

    if (!user_data.db && gtmeecData.db) {
      user_data.db = gtmeecData.db;
    }

    if (!user_data.country && gtmeecData.country) {
